.user-table {
    margin: 2rem;
}

.el-table {
    border-radius: 10px;
    overflow: hidden;
    box-shadow: 0 4px 10px rgba(0, 0, 0, 0.1);
}

.el-table th {
    background-color: #f5f5f5;
    font-weight: bold;
    color: #333;
}

.el-table td {
    color: #555;
}

.el-button {
    font-size: 18px;
    padding: 8px 16px;
    border-radius: 5px;
    transition: all 0.3s ease;
}

.el-button:hover {
    background-color: #ff7070;
    transform: scale(1.05);
}
